■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>日本製のナイロンコードです。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0403/7180at-01.jpg" width="304" height="320"><br><font size=3>角2.3mm　ボビン巻入</font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">アルミ含有で約1.5倍長持ちです!(メーカー比)</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">アルミ含有で約1.5倍長持ちです!(メーカー比)</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">長さ：500m</font><br><font color="#333333" size="-1">個装サイズ：20×20×14cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：3420g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ナイロンロクロク</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">角2.3mm<br>ボビン巻<br>1m毎の長さマーク付</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="